            <h1 className='text-center'>Our Schedule</h1>
            <div className='calendar-container'>
                <Calendar
                    onChange={setDate}
                    value={date}
                    defaultView='month'
                    nextLabel='month>>'
                    nextAriaLabel='Go to next month'
                    next2Label='year>>'
