                    prev2Label='<<year'
                    prev2AriaLabel='Go to prev year'
                    calendarType="US"
                    tileClassName="days"
                    selectRange={true}

                    />

            </div>

            {date.length > 0 ? (
                <p className='text-center'>
                    <span className='bold'>Start Date:</span>{' '}
                    {date[0].toDateString()}
                    &nbsp;|&nbsp;
